import React, {Component} from 'react';
import styled from  'styled-components';
import loginAxios from '../Axios/LoginAxios';
import { Link } from 'react-router-dom';

class Login extends Component {
    render() {
        return(
            <div>
                <LoginForm>
                    <LoginText>로그인</LoginText>
                    <LoginInput>
                    <div> 
                    <input type='text' className='id' placeholder='아이디'></input>
                    </div>
                   <div>
                   <input type='text' className='password' placeholder='비밀번호'></input>
                   </div>
                   </LoginInput>
                   <LoginBtn>  
                      <LoginButton type="button">로그인</LoginButton>               
                   </LoginBtn>
                   <Join>
                   <Link to='/join' style={{ textDecoration: 'none' ,color:'black'  ,fontFamily: 'Jua, sanserif' }}>회원가입</Link> 
                   </Join>
                   
                </LoginForm>
            </div>
        )
    }
}

export default Login;

const LoginText = styled.h1`
    color: #00587a;
    margin-left:30px;
 
`
const LoginInput = styled.div `
    margin-left:40px;
`
const LoginForm = styled.div`
    margin-top: 180px;
    text-align:center;
`
const LoginBtn = styled.div`
   margin-left:30px;
   margin-top:30px;
   
`

const LoginButton = styled.button`
   background-color:white;
   border:1px solid black;
   border-radius:3px;
`

const Join = styled.div `
  margin-left:340px;
  width:5rem;
  margin-top:10px;
  border: 1px solid black;
`
